// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";

// AccessControl.sol better? https://github.com/OpenZeppelin/openzeppelin-contracts/tree/master/contracts/access 
contract Marketplace is Ownable {
    mapping(uint => Item) public items;
    uint private itemCount;
    string public name;
    string public imageSrc;
    bool public isOpen; //private?

    struct Item {
        uint id; // id required?
        address payable owner;
        address soldTo;
        string name;
        string imageSrc;
        uint price;
        bool sold;
        // quantity?
        // description?
    }

    // EVENTS!!!!
    // flexible for different types of items/games??
    // transfer ownership of marketplace possible??

    modifier itemAvailable(uint id_) {
        require(items[id_].id != 0 && !items[id_].sold, "Item not available.");
        _;
    }

    constructor(string memory name_, string memory imageSrc_) Ownable(_msgSender()) {
        name = name_;
        imageSrc = imageSrc_;
        isOpen = true;
    }

    function addItem(string memory name_, string memory imageSrc_, uint price_) public onlyOwner {
        itemCount++;
        items[itemCount] = Item(
            itemCount,
            payable(_msgSender()),
            address(0),
            name_,
            imageSrc_,
            price_,
            false
        );
    }

    //request purchase!

    function purchaseItem(uint id_) public payable itemAvailable(id_) {
        // change owner when sold?
        require(msg.value >= items[id_].price, "Insufficient funds.");
        items[id_].soldTo = _msgSender(); // payable?
        items[id_].sold = true;
        items[id_].owner.transfer(msg.value);
    }

    function removeItem(uint id_) public onlyOwner itemAvailable(id_) {
        delete items[id_];
    }

    function updateItem(uint id_, string memory name_, string memory imageSrc_,uint price_) public onlyOwner itemAvailable(id_) {
        items[id_].name = name_;
        items[id_].imageSrc = imageSrc_;
        items[id_].price = price_;
    }

    function getAllItems() public view returns (Item[] memory) {
        Item[] memory _items = new Item[](itemCount);
        for (uint i = 1; i <= itemCount; i++) {
            _items[i - 1] = items[i];
        }
        return _items;
    }

    function getItem(uint id_) public view returns (Item memory) { // string
        return items[id_];
    }

    function close() public onlyOwner {
        // required when MarketplaceRegistry.sol is implemented???
        require(
            allItemsSold(),
            "Not all items in this marketplce have been sold."
        );
        isOpen = false;
    }

    function allItemsSold() internal view returns (bool) {
        for (uint i = 1; i <= itemCount; i++) {
            if (!items[i].sold) {
                return false;
            }
        }
        return true;
    }
}
